  <h1
    style="margin-top:12pt; margin-bottom:0pt; text-align:center; page-break-inside:avoid; page-break-after:avoid; line-height:108%; font-size:16pt;">
    <em><span style="font-family:'Calibri Light'; letter-spacing:0.25pt; color:#2f5496;">Informed Consent
        Form</span></em>
  </h1>
  <p style="margin-top:0pt; margin-bottom:8pt; text-align:center;"><span
      style="letter-spacing:0.75pt; color:#5a5a5a;">Research Project: The Effects of Online Professional Learning
      Communities on Computer Science Education</span></p>
  <p style="margin-top:0pt; margin-bottom:8pt;">IRB Project #23359</p>
  <p style="margin-top:0pt; margin-bottom:8pt;">&nbsp;</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Purpose of the Research:&nbsp;</strong>The purpose of this study
    is to determine key factors in the success of an online professional learning community, and what factors allow
    members to grow in identity and knowledge in relation to Computer Science Education. The investigators seek to
    better understand teachers&rsquo; identities in Computer Science Education, as well as what factors cause growth in
    said identity. In addition, investigators seek to understand the key aspects of an online professional learning
    community that allow one to succeed in place of an in-person professional learning community. As a user of
    ConneCTION, you have the option to participate or not participate in this research.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;">&nbsp;</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Procedures</strong>: Participation in this study includes
    completing 3 surveys throughout the course of a year regarding identity, content knowledge and pedagogical content
    knowledge, and opinions of the online professional learning community. This will continue for 3 years. In addition,
    certain personal data will be gathered, such as: geo-location, school name, grade levels taught, subject taught, and
    comments and posts written on ConneCTION. This data will be collected passively as you interact with conneCTION, as
    well as at account creation. Users who choose not to participate in research are freely encouraged to use the site,
    and all data will be discarded by the researchers.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;">By signing this informed consent, you are stating that your
    aforementioned personal data and survey responses can be used in this research.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Risks and/or Discomforts:</strong> There are no known risks or
    discomforts associated with this research.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Benefits:&nbsp;</strong>There are no direct benefits for
    participants. However, participants would contribute to the improvement of computer science education for teachers.
  </p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Eligibility:</strong> To participate in this research, you must
    be an in-service or retired K-12 teacher.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Confidentiality:</strong></p>
  <p style="margin-top:0pt; margin-bottom:8pt;">This study is collecting data from you. We would like to make your data
    available for other research studies that may be done in the future. The research may be about similar study aims or
    topics. However, research could also be about unrelated topics, or other types of research. These studies may be
    done by researchers at this institution or other institutions, including commercial entities. Our goal is to make
    more research possible. Your name and identifying information will be removed from any data you provide before they
    are shared with other researchers. Researchers that receive your information cannot easily link your identifying
    information to the data.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;">Reasonable steps will be taken protect the privacy and confidentiality
    of your study data; however, in some circumstances we cannot guarantee absolute privacy and/or confidentiality.
    Research records will be stored electronically through University of Nebraska &ndash; Lincoln approved methods.
    Records will only be seen by the research team and/or those authorized to view, access, or use the records during
    and after the study is complete.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;">Any information obtained during this study, which could identify you,
    will be kept confidential. The data will be stored electronically on UNL servers behind the firewall and will be
    password protected to protect your privacy. Prior to any publication, all identifying information will be
    anonymized.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Compensation:</strong> Participants will be entered into $50
    raffles at the completion of each survey, with drawings being done per 20 responses. These $50 will be given as an
    Amazon gift card. The odds of receiving a gift card are 5%.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Opportunity to Ask Questions:&nbsp;</strong>You may ask any
    questions concerning this research and have those questions answered before agreeing to participate or during the
    research period. You may contact the principal investigator or secondary investigator shown below.</p>
