  <p style="margin-top:0pt; margin-bottom:8pt;">If you have any questions concerning your rights as a research subject
    that have not been answered by the investigator, or to report any concerns about this study, you may contact the
    University of Nebraska-Lincoln Institutional Review Board, telephone (402) 472-6965.</p>
  <p style="margin-top:0pt; margin-bottom:8pt;"><strong>Freedom to Withdraw:&nbsp;</strong>Participation is voluntary.
    You are free to decide not to allow us to use your data in the research or to withdraw at any time without adversely
    affecting your relationship with the investigators, or the university. Your decision will not result in any loss of
    benefits to which you are otherwise entitled. You are voluntarily making a decision whether or not to participate in
    this study. Note that if you wish to withdraw, you must do so before data records are de-identified at the end of
    the study.</p>
